import React from "react";
import { HeroContainer, Image } from './Hero.styles';
import FarmImage from '../../../assets/farm.png'


const Hero = () => {
    return (
      <HeroContainer>
      <Image>
          <img src={FarmImage} alt="Logo" />
          <div>aaaaaaaaaaa</div>
      </Image>
    
  </HeroContainer>
    );
};

export default Hero;
